{
  "openapi": "3.0.0",
  "info": {
    "title": "node-starter",
    "version": "0.1.0",
    "description": "Node Starter",
    "contact": {
      "name": "Ali Mehasin",
      "url": "alimehasin.com"
    }
  },
  "servers": [],
  "paths": {
    "/users/login": {
      "post": {
        "summary": "Login",
        "operationId": "post-users-login",
        "responses": {
          "200": {
            "description": "OK",
            "content": {
              "application/json": {
                "schema": {
                  "description": "",
                  "type": "object",
                  "properties": {
                    "accessToken": {
                      "type": "string",
                      "minLength": 1
                    },
                    "user": {
                      "type": "object",
                      "properties": {
                        "id": {
                          "type": "string",
                          "minLength": 1
                        },
                        "username": {
                          "type": "string",
                          "minLength": 1
                        },
                        "firstName": {
                          "type": "string",
                          "minLength": 1
                        },
                        "lastName": {
                          "type": "string",
                          "minLength": 1
                        },
                        "email": {
                          "type": "string",
                          "minLength": 1
                        }
                      },
                      "required": [
                        "id",
                        "username",
                        "firstName",
                        "lastName",
                        "email"
                      ]
                    }
                  },
                  "required": [
                    "accessToken",
                    "user"
                  ],
                  "x-examples": {
                    "example-1": {
                      "accessToken": "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6Ijc3NjljYWZkLTk5ZTgtNDRkZC05MDUxLWQxODgzYTBhNTBlMyIsInR5cGUiOiJBQ0NFU1MiLCJpYXQiOjE2NDkyNjYwMjcsImV4cCI6MTY0OTI2OTYyN30.9Xf-KvpKE7paowAAtco1NRUBPlBhoLfDEAViAIV-nYo",
                      "user": {
                        "id": "7769cafd-99e8-44dd-9051-d1883a0a50e3",
                        "username": "alice",
                        "firstName": "Alice",
                        "lastName": "Smith",
                        "email": "alice@example.com"
                      }
                    }
                  }
                }
              }
            }
          }
        },
        "description": "Login to your account\nThis will set 2 cookies\n1. access-token (HTTP only)\n2. user",
        "requestBody": {
          "content": {
            "application/json": {
              "schema": {
                "description": "",
                "type": "object",
                "properties": {
                  "username": {
                    "type": "string",
                    "minLength": 1
                  },
                  "password": {
                    "type": "string",
                    "minLength": 1
                  }
                },
                "required": [
                  "username",
                  "password"
                ],
                "x-examples": {
                  "example-1": {
                    "username": "alice",
                    "password": "password"
                  }
                }
              }
            }
          }
        }
      }
    },
    "/users/signup": {
      "post": {
        "summary": "Signup",
        "operationId": "post-users-signup",
        "responses": {
          "200": {
            "description": "OK",
            "content": {
              "application/json": {
                "schema": {
                  "description": "",
                  "type": "object",
                  "x-examples": {
                    "example-1": {
                      "id": "7769cafd-99e8-44dd-9051-d1883a0a50e3",
                      "username": "alice",
                      "firstName": "Alice",
                      "lastName": "Smith",
                      "email": "alice@example.com"
                    }
                  },
                  "properties": {
                    "id": {
                      "type": "string",
                      "minLength": 1
                    },
                    "username": {
                      "type": "string",
                      "minLength": 1
                    },
                    "firstName": {
                      "type": "string",
                      "minLength": 1
                    },
                    "lastName": {
                      "type": "string",
                      "minLength": 1
                    },
                    "email": {
                      "type": "string",
                      "minLength": 1
                    }
                  },
                  "required": [
                    "id",
                    "username",
                    "firstName",
                    "lastName",
                    "email"
                  ]
                }
              }
            }
          }
        },
        "requestBody": {
          "content": {
            "application/json": {
              "schema": {
                "description": "",
                "type": "object",
                "x-examples": {
                  "example-1": {
                    "username": "alice",
                    "password": "password",
                    "firstName": "Alice",
                    "lastName": "Smith",
                    "email": "alice@example.com"
                  }
                },
                "properties": {
                  "username": {
                    "type": "string",
                    "minLength": 1
                  },
                  "password": {
                    "type": "string",
                    "minLength": 1
                  },
                  "firstName": {
                    "type": "string",
                    "minLength": 1
                  },
                  "lastName": {
                    "type": "string",
                    "minLength": 1
                  },
                  "email": {
                    "type": "string",
                    "minLength": 1
                  }
                },
                "required": [
                  "username",
                  "password"
                ]
              }
            }
          }
        },
        "description": "Sign up"
      }
    },
    "/users/profile": {
      "get": {
        "summary": "Profile",
        "tags": [],
        "responses": {},
        "operationId": "get-users-profile",
        "description": "Get your profile data (No need to send anything)"
      }
    },
    "/users/change-password": {
      "post": {
        "summary": "Change password",
        "operationId": "post-users-change-password",
        "responses": {
          "200": {
            "description": "OK",
            "content": {
              "application/json": {
                "schema": {
                  "description": "",
                  "type": "object",
                  "properties": {
                    "message": {
                      "type": "string",
                      "minLength": 1
                    }
                  },
                  "required": [
                    "message"
                  ],
                  "x-examples": {
                    "example-1": {
                      "message": "Your password has been successfully updated"
                    }
                  }
                }
              }
            }
          },
          "400": {
            "description": "Bad Request",
            "content": {
              "application/json": {
                "schema": {
                  "description": "",
                  "type": "object",
                  "properties": {
                    "detail": {
                      "type": "string",
                      "minLength": 1
                    }
                  },
                  "required": [
                    "detail"
                  ],
                  "x-examples": {
                    "example-1": {
                      "detail": "Old password is not correct"
                    }
                  }
                }
              }
            }
          },
          "401": {
            "description": "Unauthorized",
            "content": {
              "application/json": {
                "schema": {
                  "description": "",
                  "type": "object",
                  "properties": {
                    "detail": {
                      "type": "string",
                      "minLength": 1
                    }
                  },
                  "required": [
                    "detail"
                  ],
                  "x-examples": {
                    "example-1": {
                      "detail": "Unable to authenticate the user"
                    }
                  }
                }
              }
            }
          }
        },
        "description": "Change your password\nThe user should be authenticated in order to perform this action",
        "requestBody": {
          "content": {
            "application/json": {
              "schema": {
                "description": "",
                "type": "object",
                "properties": {
                  "oldPassword": {
                    "type": "string",
                    "minLength": 1
                  },
                  "newPassword": {
                    "type": "string",
                    "minLength": 1
                  }
                },
                "required": [
                  "oldPassword",
                  "newPassword"
                ],
                "x-examples": {
                  "example-1": {
                    "oldPassword": "newPassword",
                    "newPassword": "newPassword"
                  }
                }
              }
            }
          }
        }
      }
    },
    "/users/logout": {
      "post": {
        "summary": "Logout",
        "operationId": "post-users-logout",
        "responses": {
          "200": {
            "description": "OK"
          }
        },
        "description": "Logout request will perform the following\n1. Delete auth cookies\n2. Revoke the tokens and the older version"
      }
    }
  },
  "components": {
    "schemas": {
      "User": {
        "title": "User",
        "type": "object",
        "properties": {
          "id": {
            "type": "string",
            "format": "uuid",
            "readOnly": true
          },
          "username": {
            "type": "string"
          },
          "password": {
            "type": "string"
          },
          "firstName": {
            "type": "string"
          },
          "lastName": {
            "type": "string"
          },
          "email": {
            "type": "string",
            "format": "email"
          }
        },
        "required": [
          "username",
          "password"
        ]
      }
    }
  }
}
